import logo from './logo.svg';
import arrow from './arrow.png'
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
      <div class="barre">
        <br></br>
        <div class = "texte_header">Lacanau - qualité des eaux à la date du dd/mm/yyyy</div>
        <br></br>
      </div>
      <div class = "texte1"> Taux de pollution du jour : XX</div>
      <div class = "arrow"> <arrow></arrow> </div>
      </header>
    </div>
  );
}

export default App;
